    return (
      <Card border="dark" className=''>
        <Card.Body>
          <Container>
            <Card.Title>{title}</Card.Title>
            <Card.Text style={{ whiteSpace: "pre" }}>{body}</Card.Text>
            {/* <Card.Link href="#">Card Link</Card.Link>
          <Card.Link href="#">Another Link</Card.Link> */}
          </Container>
        </Card.Body>
      </Card>
    );
}

export default PoetryCard;
